create database mi;
use mi;

CREATE TABLE VehicleInfo (
                             vid VARCHAR(16) PRIMARY KEY,
                             carId INT,
                             batteryType VARCHAR(10),
                             totalMileage INT,
                             batteryHealthStatus INT
)CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;

CREATE TABLE Rule (
                      ruleId INT AUTO_INCREMENT PRIMARY KEY,
                      ruleNo INT,
                      name VARCHAR(20),
                      batteryType VARCHAR(10),
                      warningRule VARCHAR(255)
)CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;

drop table signalreport;
CREATE TABLE SignalReport  (
                               reportId INT AUTO_INCREMENT PRIMARY KEY,
                               carId INT NOT NULL,
                               warnId INT DEFAULT NULL,
                               signalString VARCHAR(255),
                               batteryType VARCHAR(20),
                               warnName VARCHAR(20),
                               warnLevel INT DEFAULT NULL,
                               INDEX idx_carId (carId) -- 为 carId 字段添加索引
)CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci;

SELECT * FROM SignalReport;






